Und ferner sprach Gott zu Moses: Dies sollst du den Söhnen Israels sagen: Der Herr, der Gott eurer Väter, der Gott Abrahams, der Gott Isaaks, und der Gott Jakobs hat mich zu euch gesendet; das ist mein Name in Ewigkeit, und so gedenke man meiner von Geschlecht zu Geschlecht.
Gehe hin, und versammle die Ältesten von Israel, und sprich zu ihnen: Der Herr, der Gott eurer Väter, ist mir erschienen, der Gott Abrahams, der Gott Isaaks, und der Gott Jakobs, und hat gesagt: Ich habe euch in Gnaden heimgesucht und alles gesehen, was euch in Ägypten widerfahren ist;
und ich habe beschlossen, euch aus der Bedrückung Ägyptens wegzuführen, in das Land der Chananiter, Hethiter, Amorrhiter, Phereziter, Heviter, und Jebusiter, in ein Land, das von Milch und Honig fließt.
